DELIMITER $$
CREATE TRIGGER `trg_contacts_validate_rfc_insert` BEFORE INSERT ON `contacts` FOR EACH ROW BEGIN
  IF NEW.rfc IS NOT NULL AND NEW.rfc != '' THEN
    IF CHAR_LENGTH(NEW.rfc) = 12 THEN
      SET NEW.person_type = 'moral';
    ELSEIF CHAR_LENGTH(NEW.rfc) = 13 THEN
      SET NEW.person_type = 'fisica';
    END IF;
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `trg_contacts_validate_rfc_update` BEFORE UPDATE ON `contacts` FOR EACH ROW BEGIN
  IF NEW.rfc IS NOT NULL AND NEW.rfc != '' THEN
    IF CHAR_LENGTH(NEW.rfc) = 12 THEN
      SET NEW.person_type = 'moral';
    ELSEIF CHAR_LENGTH(NEW.rfc) = 13 THEN
      SET NEW.person_type = 'fisica';
    END IF;
  END IF;
END
$$
DELIMITER ;

