,`business_name` varchar(255)
,`commercial_name` varchar(255)
,`contact_type` enum('prospecto','afiliado','exafiliado','siem','invitado','funcionario_gobierno','nuevo_usuario','funcionario','publico_general','consejero_propietario','consejero_invitado','patrocinador','mesa_directiva','colaborador_empresa')
,`membership_type_id` int(10) unsigned
