--
-- Estructura para la vista `vw_membership_courtesy_eligibility`
--
DROP TABLE IF EXISTS `vw_membership_courtesy_eligibility`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_membership_courtesy_eligibility`  AS SELECT `c`.`id` AS `contact_id`, `c`.`business_name` AS `business_name`, `c`.`commercial_name` AS `commercial_name`, `c`.`contact_type` AS `contact_type`, `c`.`membership_type_id` AS `membership_type_id`, `mt`.`name` AS `membership_name`, `mt`.`code` AS `membership_code`, (case when (`mt`.`code` in ('BASICA','PYME','EMPRENDEDOR','VISIONARIO','PREMIER','PATROCINADOR_OFICIAL','PATROCINADOR_AAA','NAMING_RIGHTS')) then 1 else 0 end) AS `courtesy_eligible`, (select count(0) from `event_registrations` `er` where ((`er`.`contact_id` = `c`.`id`) and (`er`.`is_courtesy_ticket` = 1) and (`er`.`payment_status` = 'courtesy'))) AS `courtesy_tickets_used` FROM (`contacts` `c` left join `membership_types` `mt` on((`c`.`membership_type_id` = `mt`.`id`))) WHERE (`c`.`contact_type` = 'afiliado') ;

